import { useEffect } from "react";
import { TextField, Button } from "@mui/material";
import { css, keyframes } from "@emotion/css";

const animationFadeIn = keyframes`
    0% {
        opacity: 0;
    }
    100% {
        opacity: 1;
    }
  `;
const Login = () => {
  useEffect(() => {
    const scrollAnimElements = document.querySelectorAll(
      "[data-animate-on-scroll]"
    );
    const observer = new IntersectionObserver(
      (entries) => {
        for (const entry of entries) {
          if (entry.isIntersecting || entry.intersectionRatio > 0) {
            const targetElement = entry.target;
            targetElement.classList.add("animate");
            observer.unobserve(targetElement);
          }
        }
      },
      {
        threshold: 0.15,
      }
    );

    for (let i = 0; i < scrollAnimElements.length; i++) {
      observer.observe(scrollAnimElements[i]);
    }

    return () => {
      for (let i = 0; i < scrollAnimElements.length; i++) {
        observer.unobserve(scrollAnimElements[i]);
      }
    };
  }, []);

  return (
    <div
      className={css`
        position: relative;
        border-radius: var(--br-5xl);
        background-color: var(--white-color);
        width: 100%;
        height: 1080px;
        overflow: hidden;
        opacity: 0;
        text-align: left;
        font-size: 32px;
        color: var(--white-color);
        font-family: var(--font-poppins);
        &.animate {
          animation: 1s ease 0s 1 normal forwards ${animationFadeIn};
        }
      `}
      data-animate-on-scroll
    >
      <div
        className={css`
          position: absolute;
          top: 0px;
          right: 0px;
          background: linear-gradient(217.64deg, #9181f4, #5038ed);
          width: 683px;
          height: 768px;
        `}
      />
      <img
        className={css`
          position: absolute;
          top: 0px;
          right: 0px;
          width: 1073px;
          height: 1295px;
          object-fit: cover;
        `}
        alt=""
        src="/rectangle-43@2x.png"
      />
      <div
        className={css`
          position: absolute;
          top: calc(50% - 360px);
          left: calc(50% + 166px);
          border-radius: 46px;
          background-color: var(--color-gray-400);
          backdrop-filter: blur(13.6px);
          border: 1px solid var(--color-gray-300);
          box-sizing: border-box;
          width: 548px;
          height: 720px;
        `}
      />
      <img
        className={css`
          position: absolute;
          top: 125px;
          right: 259px;
          width: 964px;
          height: 778px;
          object-fit: cover;
        `}
        alt=""
        src="/women-with-tab-11@2x.png"
      />
      <form
        className={css`
          position: absolute;
          top: 125px;
          left: 81px;
          width: 703px;
          height: 857px;
        `}
      >
        <div
          className={css`
            position: absolute;
            top: 548.77px;
            left: 0px;
            width: 671.57px;
            display: flex;
            flex-direction: column;
            padding: 21.018537521362305px var(--padding-0) 22.44749641418457px;
            box-sizing: border-box;
            align-items: center;
            justify-content: flex-end;
          `}
        >
          <img
            className={css`
              align-self: stretch;
              position: relative;
              max-width: 100%;
              overflow: hidden;
              height: 1.43px;
              flex-shrink: 0;
            `}
            alt=""
            src="/subtract1.svg"
          />
        </div>
        <div
          className={css`
            position: absolute;
            top: 617px;
            left: 0px;
            font-size: 22.86px;
            text-align: center;
            display: inline-block;
            width: 671.57px;
          `}
        >
          <b
            className={css`
              font-family: var(--font-poppins);
              color: var(--color-gray-200);
            `}
          >
            Login
          </b>
          <span
            className={css`
              font-family: var(--font-poppins);
              color: var(--color-dimgray);
            `}
          >
            {" "}
            with Others
          </span>
        </div>
        <b
          className={css`
            position: absolute;
            top: 13px;
            left: 222px;
            font-size: 71.44px;
            text-transform: uppercase;
            display: inline-block;
            font-family: var(--font-poppins);
            color: var(--color-black);
            text-align: left;
            width: 227.19px;
            height: 67.16px;
          `}
        >
          Login
        </b>
        <div
          className={css`
            position: absolute;
            top: 146px;
            left: 89px;
            font-size: 22.86px;
            font-family: var(--font-poppins);
            color: var(--color-dimgray);
            text-align: left;
            display: inline-block;
            width: 614.41px;
            height: 44.29px;
          `}
        >{`Get Started If you dont have an account ? `}</div>
        <TextField
          className={css`
            border: none;
            background-color: transparent;
            position: absolute;
            top: 342px;
            left: 0px;
          `}
          sx={{ width: 671.5650634765625 }}
          color="primary"
          variant="filled"
          label="Password"
        />
        <TextField
          className={css`
            border: none;
            background-color: transparent;
            position: absolute;
            top: 221px;
            left: 0px;
          `}
          sx={{ width: 671.5650634765625 }}
          color="primary"
          variant="filled"
          type="text"
          label="Username"
          placeholder="Placeholder"
          size="medium"
          margin="none"
        />
        <Button
          className={css`
            position: absolute;
            top: 452px;
            left: 0px;
          `}
          sx={{ width: 301 }}
          variant="contained"
          color="secondary"
          size="large"
          href="/search"
        >
          Login
        </Button>
        <div
          className={css`
            position: absolute;
            top: 675px;
            left: 0px;
            width: 671.57px;
            display: flex;
            flex-direction: column;
            padding: var(--padding-0) var(--padding-0) 0.00004360539969638921px;
            box-sizing: border-box;
            align-items: center;
            justify-content: flex-start;
            gap: 28.58px;
          `}
        >
          <div
            className={css`
              align-self: stretch;
              border-radius: 22.86px;
              border: 1.4px solid var(--color-lavender);
              display: flex;
              flex-direction: column;
              padding: var(--padding-0) 202.94546508789062px;
              align-items: flex-start;
              justify-content: center;
            `}
          >
            <div
              className={css`
                align-self: stretch;
                height: 56.12px;
                display: flex;
                flex-direction: row;
                align-items: center;
                justify-content: flex-start;
                gap: 14.29px;
              `}
            >
              <img
                className={css`
                  position: relative;
                  width: 55.35px;
                  height: 56.12px;
